import React from "react";
import "./index.css"
const App =()=>{
    let name = "virat soni"
    const run=(e)=>{
      console.log(e.target.value)
    }

    return(
        <>
        <div>
            <h1>Hello {name}</h1>
            <input onChange={run} type="text" placeholder="Enter Your Name" defaultValue=""/>
            <button >click me!</button>
        </div>
        </>
    )
}
export default App
